  return (
    <div className="App">
     <div className= 'logo-contenedor'>
      <img src={calculadoraLogo}
      className='calculadora-logo'
      alt='logo de calculador'
      >
        <p> calculadora</p>
      </img>

     </div>
    </div>
  );
}

export default App;
